import React from 'react';
import "../CSS/about.css";
import { FaAsterisk } from 'react-icons/fa';

class About extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      firstname: '',
      lastname: '',
      feedback: '',
    };
  }

  handleInputChange = (event) => {
    this.setState({
      [event.target.name]: event.target.value,
    });
  };

  handleSubmit = (event) => {
    event.preventDefault();

    const { firstname, lastname, feedback} = this.state;

    const formUrl = 'https://docs.google.com/forms/d/e/1FAIpQLSdYBNmX9fG4pdd4aOKSy1kp8MKsz_WXGShvYwvrJBaPx3dIPA/viewform?usp=sf_link'; // Form url

    const queryParams = new URLSearchParams();
    queryParams.append('entry.1357543160', firstname); // Entry.id we will get by inspecting. Field id
    queryParams.append('entry.2122240541', lastname);
    queryParams.append('entry.193363044', feedback); 

    const formSubmissionUrl = `${formUrl}?${queryParams.toString()}`;

    window.location.href = formSubmissionUrl;
  };

  render(){
  return (
    <div>
      <h1>About Us</h1>
      <p>
        Welcome to our artistic haven, where creativity flourishes and the worlds of art, painting, and DJing converge. We are passionate about curating immersive experiences that blend the visual arts, the strokes of a brush, and the beats that move your soul. Whether you're drawn to the vibrant colors on canvas, the transformative power of a well-executed stroke, or the pulsating rhythms that command your feet to dance, our mission is to transport you to a realm where artistry knows no limits. Join us on this extraordinary journey as we celebrate the synergy between art, painting, and DJing, and explore the boundless possibilities that lie within the realms of creativity.
      </p>

      <section className="values-section">
        <h2>Our Values</h2>
        <p>
          At our core, we value quality, customer satisfaction, integrity, and collaboration. These values drive our commitment to delivering excellence, exceeding customer expectations, upholding ethical practices, and fostering a collaborative environment. We believe in the power of these values to guide our decisions and actions, ensuring our customers receive the best and our partnerships thrive.
        </p>
        <ul>
          <li>Quality</li>
          <li>Customer Satisfaction</li>
          <li>Integrity</li>
          <li>Collaboration</li>
        </ul>
      </section>

      <section className = "testimonial-section">
        <h1>Testimonials</h1>
        <div className="testimonial">
          <h3>- Abha Jha</h3>
          <p>Amazing experience with Adaah. Highly recommended!</p>

        </div>
        <div className="testimonial">
          <h3>- Shubham Choudhary</h3>
          <p>Their service exceeded my expectations. Will definitely use again!</p>
        </div>
      </section>

      <div>
        <h1 className = "feedback-heading">Leave Feedback</h1>
        <div className = "feedback-form">
          <form className = "aboutform" onSubmit={this.handleSubmit}>
            <div>
              <label htmlFor="firstname">First Name <FaAsterisk className = 'fa-icons'/> :</label>
              <input
                type="text"
                id="firstname"
                name="firstname"
                value={this.state.name}
                onChange={this.handleInputChange}
                required
              />
            </div>

            <div>
              <label htmlFor="lastname">Last Name <FaAsterisk className = 'fa-icons'/> :</label>
              <input
                type="text"
                id="lastname"
                name="lastname"
                value={this.state.name}
                onChange={this.handleInputChange}
                required
              />
            </div>

            <div>
              <label htmlFor="feedback">Feedback <FaAsterisk className = 'fa-icons'/> :</label>
              <textarea
                id="feedback"
                name="feedback"
                value={this.state.message}
                onChange={this.handleInputChange}
                required
              ></textarea>
            </div>
            <button type="submit">Submit</button>
          </form>
        </div>
      </div>
    </div>
  );
}
}

export default About;
